import moment from "moment";
import _ from "underscore";
import { ITitleBase } from "./../Interfaceses/ITitleBase";

export interface GroupEntity {}

export default (entities: ITitleBase) => {
  var groups = _.groupBy(entities, function (entity: ITitleBase) {
    return moment(entity.lastUpdated).startOf("day").format();
  });
  return groups;
};
